tps:\/\/ru.wikipedia.org\/wiki\/1547_%D0%B3%D0%BE%D0%B4\" title=\"1547 \u0433\u043e\u0434\">1547<\/a>&#160;\u2014 \u044d\u043f\u0438\u0437\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%BE-%D1%88%D0%BE%D1%82%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B\" title=\"\u0410\u043d\u0433\u043b\u043e-\u0448\u043e\u0442\u043b\u0430\u043d\u0434\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u043d\u044b\">\u0410\u043d\u0433\u043b\u043e-\u0448\u043e\u0442\u043b\u0430\u043d\u0434\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u043d<\/a>: \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9F%D0%B8%D0%BD%D0%BA%D0%B8\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041f\u0438\u043d\u043a\u0438\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041f\u0438\u043d\u043a\u0438<\/a>, \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u0432\u0448\u0430\u044f\u0441\u044f \u043f\u043e\u0431\u0435\u0434\u043e\u0439 \u0430\u043d\u0433\u043b\u0438\u0447\u0430\u043d \u0438 \u0441\u043f\u043e\u0441\u043e\u0431\u0441\u0442\u0432\u043e\u0432\u0430\u0432\u0448\u0430\u044f \u0440\u0430\u0437\u0440\u044b\u0432\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BE%D1%82%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D0%BA%D0%BE%D0%B5_%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0441\u043a\u043e\u0435 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e\">\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D1%82%D0%B2%D0%BE_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e \u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0435\u043d\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%84%D0%BE%D1%80%D0%BC%D0%B0%D1%86%D0%B8%D1%8F_%D0%B2_%D0%A8%D0%BE%D1%82%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D0%B8\" title=\"\u0420\u0435\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044f \u0432 \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u0438\">\u043f\u0440\u043e\u0442\u0435\u0441\u0442\u0430\u043d\u0442\u0438\u0437\u043c\u0430 \u0432 \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1588_%D0%B3%D0%BE%D0%B4\" title=\"1588 \u0433\u043e\u0434\">1588<\/a>&#160;\u2014 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043c\u043e\u0440\u0435\u043f\u043b\u0430\u0432\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%8D%D0%B2%D0%B5%D0%BD%D0%B4%D0%B8%D1%88,_%D0%A2%D0%BE%D0%BC%D0%B0%D1%81\" title=\"\u041a\u044d\u0432\u0435\u043d\u0434\u0438\u0448, \u0422\u043e\u043c\u0430\u0441\">\u0422\u043e\u043c\u0430\u0441 \u041a\u0430\u0432\u0435\u043d\u0434\u0438\u0448<\/a> \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b \u0442\u0440\u0435\u0442\u044c\u044e \u0443\u0441\u043f\u0435\u0448\u043d\u0443\u044e \u043a\u0440\u0443\u0433\u043e\u0441\u0432\u0435\u0442\u043d\u0443\u044e \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1622_%D0%B3%D0%BE%D0%B4\" title=\"1622 \u0433\u043e\u0434\">1622<\/a>&#160;\u2014 \u0432 \u0440\u0430\u043c\u043a\u0430\u0445 \u0433\u043e\u043d\u0435\u043d\u0438\u0439 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D1%80%D0%B8%D1%81%D1%82%D0%B8%D0%B0%D0%BD%D1%81%D1%82%D0%B2%D0%BE_%D0%B2_%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D0%B8\" title=\"\u0425\u0440\u0438\u0441\u0442\u0438\u0430\u043d\u0441\u0442\u0432\u043e \u0432 \u042f\u043f\u043e\u043d\u0438\u0438\">\u0445\u0440\u0438\u0441\u0442\u0438\u0430\u043d \u0432 \u042f\u043f\u043e\u043d\u0438\u0438<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u043c\u043e\u0435 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B5_%D0%BC%D1%83%D1%87%D0%B5%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%BE_%D0%B2_%D0%9D%D0%B0%D0%B3%D0%B0%D1%81%D0%B0%D0%BA%D0%B8&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0435 \u043c\u0443\u0447\u0435\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0432 \u041d\u0430\u0433\u0430\u0441\u0430\u043a\u0438 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0412\u0435\u043b\u0438\u043a\u043e\u0435 \u043c\u0443\u0447\u0435\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0432 \u041d\u0430\u0433\u0430\u0441\u0430\u043a\u0438<\/a>  \u0432 \u0445\u043e\u0434\u0435 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0431\u044b\u043b\u043e \u043a\u0430\u0437\u043d\u0435\u043d\u043e 52 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430, \u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 \u0436\u0435\u043d\u0449\u0438\u043d\u044b, \u0434\u0435\u0442\u0438, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u044b\u0435 \u043c\u0438\u0441\u0441\u0438\u043e\u043d\u0435\u0440\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1693_%D0%B3%D0%BE%D0%B4\" title=\"1693 \u0433\u043e\u0434\">1693<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I\" title=\"\u041f\u0451\u0442\u0440 I\">\u041f\u0435\u0442\u0440\u043e\u043c I<\/a> \u0437\u0430\u043b\u043e\u0436\u0435\u043d\u043e \u043f\u0435\u0440\u0432\u043e\u0435 \u0441\u0443\u0434\u043d\u043e&#160;\u2014 24-\u043f\u0443\u0448\u0435\u0447\u043d\u044b\u0439 \u043a\u043e\u0440\u0430\u0431\u043b\u044c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B9_%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_(%D0%BA%D0%BE%D1%80%D0%B0%D0%B1%D0%BB%D1%8C,_1693)\" title=\"\u0421\u0432\u044f\u0442\u043e\u0439 \u041f\u0430\u0432\u0435\u043b (\u043a\u043e\u0440\u0430\u0431\u043b\u044c, 1693)\">\u0421\u0432. \u041f\u0430\u0432\u0435\u043b<\/a>\u00bb. \u0412 \u0430\u0432\u0433\u0443\u0441\u0442\u0435 \u041f\u0451\u0442\u0440 \u043f\u0440\u0438\u0431\u044b\u043b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D1%85%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB%D1%8C%D1%81%D0%BA\" title=\"\u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u043a\">\u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u043a<\/a>, \u0433\u0434\u0435 \u043e\u043d \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0443\u0432\u0438\u0434\u0435\u043b \u043c\u043e\u0440\u0435 \u0438 \u043f\u0435\u0440\u0432\u044b\u0439 \u0433\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0438\u0439 \u0432\u043e\u0435\u043d\u043d\u044b\u0439 \u043a\u043e\u0440\u0430\u0431\u043b\u044c. \u0422\u043e\u0433\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D1%85%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB%D1%8C%D1%81%D0%BA\" title=\"\u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u043a\">\u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u043a<\/a> \u0431\u044b\u043b \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u043c\u043e\u0440\u0441\u043a\u0438\u043c \u043f\u043e\u0440\u0442\u043e\u043c \u0420\u043e\u0441\u0441\u0438\u0438, \u0441\u0432\u044f\u0437\u044b\u0432\u0430\u0432\u0448\u0438\u043c \u0435\u0451 \u0441 \u0417\u0430\u043f\u0430\u0434\u043e\u043c. \u041f\u043e \u0443\u043a\u0430\u0437\u0430\u043d\u0438\u044e \u0446\u0430\u0440\u044f \u043d\u0430 \u043e\u0441\u0442\u0440\u043e\u0432 \u0421\u043e\u043b\u043e\u043c\u0431\u0430\u043b\u0430 \u043d\u0430 \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0414\u0432\u0438\u043d\u0435 \u0437\u0430\u0432\u0435\u0437\u043b\u0438 \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u044b \u0438 \u043d\u0430\u0447\u0430\u043b\u0438 \u0441\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u0435 \u0441\u0443\u0434\u043e\u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0432\u0435\u0440\u0444\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1721_%D0%B3%D0%BE%D0%B4\" title=\"1721 \u0433\u043e\u0434\">1721<\/a>&#160;\u2014 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D1%88%D1%82%D0%B0%D0%B4%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80\" title=\"\u041d\u0438\u0448\u0442\u0430\u0434\u0442\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\">\u041d\u0438\u0448\u0442\u0430\u0434\u0442\u0441\u043a\u0438\u0439 \u043c\u0438\u0440<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D1%8F_%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" class=\"mw-redirect\" title=\"\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0435\u043b\u0438\u043a\u0443\u044e \u0421\u0435\u0432\u0435\u0440\u043d\u0443\u044e \u0432\u043e\u0439\u043d\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1724_%D0%B3%D0%BE%D0%B4\" title=\"1724 \u0433\u043e\u0434\">1724<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE-%D0%9D%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BB%D0%B0%D0%B2%D1%80%D0%B0\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e-\u041d\u0435\u0432\u0441\u043a\u0430\u044f \u043b\u0430\u0432\u0440\u0430\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e-\u041d\u0435\u0432\u0441\u043a\u0443\u044e \u041b\u0430\u0432\u0440\u0443<\/a> \u043f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u044b \u043c\u043e\u0449\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%9D%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9\" class=\"mw-redirect\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041d\u0435\u0432\u0441\u043a\u0438\u0439\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u041d\u0435\u0432\u0441\u043a\u043e\u0433\u043e<\/a>. \u042d\u0442\u043e \u0441\u043e\u0431\u044b\u0442\u0438\u0435 \u043e\u0442\u043c\u0435\u0447\u0430\u0435\u0442\u0441\u044f \u0420\u0443\u0441\u0441\u043a\u043e\u0439 \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u043e\u0439 \u0446\u0435\u0440\u043a\u043e\u0432\u044c\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/12_%D1%81%D0%B5%D0%BD%D1%82%D1%8F%D0%B1%D1%80%D1%8F\" title=\"12 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u044f\">12 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1725_%D0%B3%D0%BE%D0%B4\" title=\"1725 \u0433\u043e\u0434\">1725<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_I\" title=\"\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 I\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 I<\/a> \u0443\u0447\u0440\u0435\u0434\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B4%D0%B5%D0%BD_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%B0_%D0%9D%D0%B5%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE\" title=\"\u041e\u0440\u0434\u0435\u043d \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u041d\u0435\u0432\u0441\u043a\u043e\u0433\u043e\">\u043e\u0440\u0434\u0435\u043d \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u041d\u0435\u0432\u0441\u043a\u043e\u0433\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1756_%D0%B3%D0%BE%D0%B4\" title=\"1756 \u0433\u043e\u0434\">1756<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%BE%D0%B7%D0%B5_I\" title=\"\u0416\u043e\u0437\u0435 I\">\u0416\u043e\u0437\u0435 I<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u044b\u0432\u0430\u0435\u0442 \u0443\u043a\u0430\u0437, \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0435\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BC%D0%B1%D0%B0%D0%BB,_%D0%A1%D0%B5%D0%B1%D0%B0%D1%81%D1%82%D1%8C%D1%8F%D0%BD_%D0%96%D0%BE%D0%B7%D0%B5\" title=\"\u041f\u043e\u043c\u0431\u0430\u043b, \u0421\u0435\u0431\u0430\u0441\u0442\u044c\u044f\u043d \u0416\u043e\u0437\u0435\">\u0421\u0435\u0431\u0430\u0441\u0442\u044c\u044f\u043d\u043e\u043c \u0416\u043e\u0437\u0435 \u0434\u0438 \u041a\u0430\u0440\u0432\u0430\u043b\u044c\u044e \u0438 \u041c\u0435\u043b\u0443<\/a> \u043e\u0431 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0432 \u043c\u0438\u0440\u0435 \u0440\u0430\u0437\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u043d\u043e\u0433\u043e \u0440\u0435\u0433\u0438\u043e\u043d\u0430 \u0434\u043b\u044f \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u0430 \u0432\u0438\u043d\u0430 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82%D0%B2%D0%B5%D0%B9%D0%BD\" title=\"\u041f\u043e\u0440\u0442\u0432\u0435\u0439\u043d\">\u041f\u043e\u0440\u0442\u0432\u0435\u0439\u043d\u0430<\/a>) \u0438 \u0442\u0430\u043a\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c \u043e\u0441\u043d\u043e\u0432\u044b\u0432\u0430\u0435\u0442 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0443\u044e \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Real_Companhia_Velha\" title=\"Real Companhia Velha\">Companhia Geral da Agricultura das Vinhas do Alto Douro<\/a>. \u041d\u044b\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%82%D1%83-%D0%94%D0%BE%D1%80%D1%83\" title=\"\u0410\u043b\u0442\u0443-\u0414\u043e\u0440\u0443\">\u044d\u0442\u043e\u0442 \u0440\u0435\u0433\u0438\u043e\u043d<\/a> \u0432\u043d\u0435\u0441\u0451\u043d \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BE%D0%B1%D1%8A%D0%B5%D0%BA%D1%82%D0%BE%D0%B2_%D0%B2%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D0%B8%D1%8F_%D0%AE%D0%9D%D0%95%D0%A1%D0%9A%D0%9E_%D0%B2_%D0%9F%D0%BE%D1%80%D1%82%D1%83%D0%B3%D0%B0%D0%BB%D0%B8%D0%B8\" title=\"\u0421\u043f\u0438\u0441\u043e\u043a \u043e\u0431\u044a\u0435\u043a\u0442\u043e\u0432 \u0432\u0441\u0435\u043c\u0438\u0440\u043d\u043e\u0433\u043e \u043d\u0430\u0441\u043b\u0435\u0434\u0438\u044f \u042e\u041d\u0415\u0421\u041a\u041e \u0432 \u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u0438\">\u0421\u043f\u0438\u0441\u043e\u043a \u043e\u0431\u044a\u0435\u043a\u0442\u043e\u0432 \u0432\u0441\u0435\u043c\u0438\u0440\u043d\u043e\u0433\u043e \u043d\u0430\u0441\u043b\u0435\u0434\u0438\u044f \u042e\u041d\u0415\u0421\u041a\u041e \u0432 \u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u0438<\/a>.<\/li><li>\u0443\u0447\u0440\u0435\u0436\u0434\u0451\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0440\u0443\u0441\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%B0%D1%82%D1%80\" title=\"\u0422\u0435\u0430\u0442\u0440\">\u0442\u0435\u0430\u0442\u0440<\/a>. \u0418\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D0%B8%D0%B7%D0%B0%D0%B2%D0%B5%D1%82%D0%B0_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%BD%D0%B0\" title=\"\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u0430 \u041f\u0435\u0442\u0440\u043e\u0432\u043d\u0430\">\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u0430 \u041f\u0435\u0442\u0440\u043e\u0432\u043d\u0430<\/a> \u0438\u0437\u0434\u0430\u043b\u0430 \u0423\u043a\u0430\u0437 \u043e\u0431 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0438\u043d\u0441\u043a\u0438\u0439 \u0442\u0435\u0430\u0442\u0440\">\u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u0434\u043b\u044f \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u0442\u0440\u0430\u0433\u0435\u0434\u0438\u0439 \u0438 \u043a\u043e\u043c\u0435\u0434\u0438\u0439 \u0442\u0435\u0430\u0442\u0440\u0430<\/a>\u00bb \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> (30 \u0430\u0432\u0433\u0443\u0441\u0442\u0430 \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%BB%D0%B8%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%B0%D0%BB%D0%B5%D0%BD%D0%B4%D0%B0%D1%80%D1%8C\" title=\"\u042e\u043b\u0438\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u0430\u043b\u0435\u043d\u0434\u0430\u0440\u044c\">\u0441\u0442\u0430\u0440\u043e\u043c\u0443 \u0441\u0442\u0438\u043b\u044e<\/a>).<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1790_%D0%B3%D0%BE%D0%B4\" title=\"1790 \u0433\u043e\u0434\">1790<\/a>&#160;\u2014 \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u043e\u0441\u0432\u044f\u0449\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%BE%D0%B8%D1%86%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE-%D0%9D%D0%B5%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%BB%D0%B0%D0%B2%D1%80%D1%8B\" title=\"\u0422\u0440\u043e\u0438\u0446\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e-\u041d\u0435\u0432\u0441\u043a\u043e\u0439 \u043b\u0430\u0432\u0440\u044b\">\u0422\u0440\u043e\u0438\u0446\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e-\u041d\u0435\u0432\u0441\u043a\u043e\u0439 \u043b\u0430\u0432\u0440\u044b<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0431\u044b\u043b \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d \u043f\u043e \u043f\u0440\u043e\u0435\u043a\u0442\u0443 \u0437\u043e\u0434\u0447\u0435\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D1%80%D0%BE%D0%B2,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%95%D0%B3%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0442\u0430\u0440\u043e\u0432, \u0418\u0432\u0430\u043d \u0415\u0433\u043e\u0440\u043e\u0432\u0438\u0447\">\u0418\u0432\u0430\u043d\u0430 \u0415\u0433\u043e\u0440\u043e\u0432\u0438\u0447\u0430 \u0421\u0442\u0430\u0440\u043e\u0432\u0430<\/a> \u0438 \u0437\u0430\u043b\u043e\u0436\u0435\u043d \u0440\u043e\u0432\u043d\u043e 12 \u043b\u0435\u0442 \u043d\u0430\u0437\u0430\u0434.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1812_%D0%B3%D0%BE%D0%B4\" title=\"1812 \u0433\u043e\u0434\">1812<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%BE-%D0%B0%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0410\u043d\u0433\u043b\u043e-\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0430\u043d\u0433\u043b\u043e-\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b 1812\u20141815 \u0433\u043e\u0434\u043e\u0432<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a href=\"https:\/\/r