0%BE%D0%BB%D0%B0%D0%B9_I\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 I\">\u041d\u0438\u043a\u043e\u043b\u0430\u044f I<\/a>) \u0432 \u043f\u0430\u043c\u044f\u0442\u044c \u043e\u0431 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%82%D0%B5%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_1812_%D0%B3%D0%BE%D0%B4%D0%B0\" title=\"\u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0432\u043e\u0439\u043d\u0430 1812 \u0433\u043e\u0434\u0430\">\u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u0435 1812 \u0433\u043e\u0434\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1855_%D0%B3%D0%BE%D0%B4\" title=\"1855 \u0433\u043e\u0434\">1855<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%8B%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041a\u0440\u044b\u043c\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041a\u0440\u044b\u043c\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: \u0422\u043e\u043b\u044c\u043a\u043e \u0447\u0435\u0440\u0435\u0437 \u0434\u0432\u0430 \u0434\u043d\u044f \u0441\u043f\u0443\u0441\u0442\u044f \u043f\u043e\u0441\u043b\u0435 \u0443\u0445\u043e\u0434\u0430 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0445 \u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u0441\u043e\u043b\u0434\u0430\u0442 \u043d\u0435\u043f\u0440\u0438\u044f\u0442\u0435\u043b\u044c&#160;\u2014 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u044b, \u0430\u043d\u0433\u043b\u0438\u0447\u0430\u043d\u0435 \u0438 \u0441\u0430\u0440\u0434\u0438\u043d\u0446\u044b&#160;\u2014 \u0440\u0435\u0448\u0438\u043b\u0441\u044f \u0432\u0441\u0442\u0443\u043f\u0438\u0442\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B0%D1%81%D1%82%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C\" title=\"\u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u044c\">\u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u044c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1875_%D0%B3%D0%BE%D0%B4\" title=\"1875 \u0433\u043e\u0434\">1875<\/a>&#160;\u2014 \u0420\u0443\u0441\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u0432\u0437\u044f\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BA%D0%B0%D0%BD%D0%B4\" title=\"\u041a\u043e\u043a\u0430\u043d\u0434\">\u041a\u043e\u043a\u0430\u043d\u0434<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1882_%D0%B3%D0%BE%D0%B4\" title=\"1882 \u0433\u043e\u0434\">1882<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%80%D0%B5%D0%B7%D0%B4%D0%B5%D0%BD\" title=\"\u0414\u0440\u0435\u0437\u0434\u0435\u043d\">\u0414\u0440\u0435\u0437\u0434\u0435\u043d\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f<\/a>) \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u043f\u0435\u0440\u0432\u0430\u044f \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044f \u0430\u043d\u0442\u0438\u0441\u0435\u043c\u0438\u0442\u043e\u0432&#160;\u2014 \u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \u043e\u0445\u0440\u0430\u043d\u044b \u043d\u0435\u0435\u0432\u0440\u0435\u0439\u0441\u043a\u0438\u0445 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1885_%D0%B3%D0%BE%D0%B4\" title=\"1885 \u0433\u043e\u0434\">1885<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u044f<\/a> \u0437\u0430\u043a\u043b\u044e\u0447\u0438\u043b\u0438 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043e\u0431 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0438 \u0440\u0443\u0441\u0441\u043a\u043e-\u0430\u0444\u0433\u0430\u043d\u0441\u043a\u043e\u0439 \u0433\u0440\u0430\u043d\u0438\u0446\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1894_%D0%B3%D0%BE%D0%B4\" title=\"1894 \u0433\u043e\u0434\">1894<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u043e\u0448\u0442\u0440\u0430\u0444\u043e\u0432\u0430\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c \u0437\u0430 \u0432\u043e\u0436\u0434\u0435\u043d\u0438\u0435 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044f \u0432 \u043f\u044c\u044f\u043d\u043e\u043c \u0432\u0438\u0434\u0435&#160;\u2014 \u0442\u0430\u043a\u0441\u0438\u0441\u0442 \u0414\u0436\u043e\u0440\u0434\u0436 \u0421\u043c\u0438\u0442. \u041d\u0435 \u0441\u043f\u0440\u0430\u0432\u0438\u0432\u0448\u0438\u0441\u044c \u0441 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435\u043c, \u043e\u043d \u0432\u044a\u0435\u0445\u0430\u043b \u0442\u043e\u0447\u043d\u043e \u0432 \u0434\u0432\u0435\u0440\u0438 \u0434\u043e\u043c\u0430. \u0428\u0442\u0440\u0430\u0444 \u0441\u043e\u0441\u0442\u0430\u0432\u0438\u043b 1 \u0444\u0443\u043d\u0442 \u0441\u0442\u0435\u0440\u043b\u0438\u043d\u0433\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1895_%D0%B3%D0%BE%D0%B4\" title=\"1895 \u0433\u043e\u0434\">1895<\/a>&#160;\u2014 \u041e\u0442\u043a\u0440\u044b\u0442 \u043a\u0430\u043d\u0430\u043b \u0421\u0443-\u0421\u0435\u043d\u0442-\u041c\u0430\u0440\u0438 \u043c\u0435\u0436\u0434\u0443 \u043e\u0437\u0451\u0440\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%85%D0%BD%D0%B5%D0%B5_(%D0%BE%D0%B7%D0%B5%D1%80%D0%BE)\" title=\"\u0412\u0435\u0440\u0445\u043d\u0435\u0435 (\u043e\u0437\u0435\u0440\u043e)\">\u0412\u0435\u0440\u0445\u043d\u0435\u0435<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D1%80%D0%BE%D0%BD_(%D0%BE%D0%B7%D0%B5%D1%80%D0%BE)\" class=\"mw-redirect\" title=\"\u0413\u0443\u0440\u043e\u043d (\u043e\u0437\u0435\u0440\u043e)\">\u0413\u0443\u0440\u043e\u043d<\/a> (\u0412\u0435\u043b\u0438\u043a\u0438\u0435 \u043e\u0437\u0451\u0440\u0430).<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1903_%D0%B3%D0%BE%D0%B4\" title=\"1903 \u0433\u043e\u0434\">1903<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u0432 \u043a\u0440\u0430\u0439\u043d\u0435 \u043f\u0440\u0430\u0432\u043e\u0439 \u0433\u0430\u0437\u0435\u0442\u0435 \u00ab\u0417\u043d\u0430\u043c\u044f\u00bb (\u0440\u0435\u0434\u0430\u043a\u0442\u043e\u0440-\u0438\u0437\u0434\u0430\u0442\u0435\u043b\u044c \u0434\u0435\u043f\u0443\u0442\u0430\u0442 \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0434\u0443\u043c\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%83%D1%88%D0%B5%D0%B2%D0%B0%D0%BD,_%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0440\u0443\u0448\u0435\u0432\u0430\u043d, \u041f\u0430\u0432\u0435\u043b \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\">\u041f\u0430\u0432\u0435\u043b \u041a\u0440\u0443\u0448\u0435\u0432\u0430\u043d<\/a>) \u043d\u0430\u0447\u0430\u043b\u0430 \u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u00ab\u041f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0430 \u0437\u0430\u0432\u043e\u0435\u0432\u0430\u043d\u0438\u044f \u043c\u0438\u0440\u0430 \u0435\u0432\u0440\u0435\u044f\u043c\u0438\u00bb. \u0422\u0430\u043a \u0432 \u0433\u0430\u0437\u0435\u0442\u0435 \u0431\u044b\u043b\u0438 \u043d\u0430\u0437\u0432\u0430\u043d\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%BE%D1%82%D0%BE%D0%BA%D0%BE%D0%BB%D1%8B_%D1%81%D0%B8%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D1%85_%D0%BC%D1%83%D0%B4%D1%80%D0%B5%D1%86%D0%BE%D0%B2\" title=\"\u041f\u0440\u043e\u0442\u043e\u043a\u043e\u043b\u044b \u0441\u0438\u043e\u043d\u0441\u043a\u0438\u0445 \u043c\u0443\u0434\u0440\u0435\u0446\u043e\u0432\">\u041f\u0440\u043e\u0442\u043e\u043a\u043e\u043b\u044b \u0441\u0438\u043e\u043d\u0441\u043a\u0438\u0445 \u043c\u0443\u0434\u0440\u0435\u0446\u043e\u0432<\/a>\u00bb&#160;\u2014 \u0444\u0430\u043b\u044c\u0448\u0438\u0432\u043a\u0430, \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043d\u0430\u044f \u043d\u0430 \u043f\u043b\u0430\u0433\u0438\u0430\u0442\u0435. \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1864_%D0%B3%D0%BE%D0%B4\" title=\"1864 \u0433\u043e\u0434\">1864 \u0433\u043e\u0434\u0443<\/a> \u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%BE%D0%BB%D0%B8,_%D0%9C%D0%BE%D1%80%D0%B8%D1%81\" title=\"\u0416\u043e\u043b\u0438, \u041c\u043e\u0440\u0438\u0441\">\u041c\u043e\u0440\u0438\u0441\u043e\u043c \u0416\u043e\u043b\u0438<\/a> \u0431\u044b\u043b \u043d\u0430\u043f\u0438\u0441\u0430\u043d \u043f\u0430\u043c\u0444\u043b\u0435\u0442 \u00ab\u0414\u0438\u0430\u043b\u043e\u0433 \u0432 \u0430\u0434\u0443 \u043c\u0435\u0436\u0434\u0443 \u041c\u043e\u043d\u0442\u0435\u0441\u043a\u044c\u0451 \u0438 \u041c\u0430\u043a\u0438\u0430\u0432\u0435\u043b\u043b\u0438\u00bb, \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u044b\u0439 \u043f\u0440\u043e\u0442\u0438\u0432 \u0440\u0435\u0436\u0438\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_III_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d III \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0430 III<\/a>. \u041f\u0430\u043c\u0444\u043b\u0435\u0442 \u0438 \u043b\u0451\u0433 \u0432 \u043e\u0441\u043d\u043e\u0432\u0443 \u00ab\u041f\u0440\u043e\u0442\u043e\u043a\u043e\u043b\u043e\u0432\u00bb, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043f\u043e\u0442\u043e\u043c \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b\u0438\u0441\u044c \u0430\u043d\u0442\u0438\u0441\u0435\u043c\u0438\u0442\u0430\u043c\u0438 \u0432\u043e \u0432\u0441\u0451\u043c \u043c\u0438\u0440\u0435. \u0418\u043c\u0438 \u043f\u0440\u0438\u043a\u0440\u044b\u0432\u0430\u043b\u0438\u0441\u044c \u043d\u0430\u0446\u0438\u0441\u0442\u044b, \u043d\u0430 \u043d\u0438\u0445 \u0441\u0441\u044b\u043b\u0430\u044e\u0442\u0441\u044f \u0438 \u0438\u0445 \u043f\u043e\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1908_%D0%B3%D0%BE%D0%B4\" title=\"1908 \u0433\u043e\u0434\">1908<\/a>&#160;\u2014 \u0420\u0443\u0441\u0441\u043a\u0438\u043c \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u043c \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 \u0424\u0438\u043d\u0441\u043a\u0430\u044f \u0410\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u043d\u0430\u0443\u043a \u0438 \u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1912_%D0%B3%D0%BE%D0%B4\" title=\"1912 \u0433\u043e\u0434\">1912<\/a>&#160;\u2014 \u0421 \u0437\u0430\u0434\u0435\u0440\u0436\u043a\u043e\u0439 \u043d\u0430 \u0434\u0435\u043d\u044c \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B4%D0%BE%D0%B2,_%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D0%B9_%D0%AF%D0%BA%D0%BE%D0%B2%D0%BB%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0435\u0434\u043e\u0432, \u0413\u0435\u043e\u0440\u0433\u0438\u0439 \u042f\u043a\u043e\u0432\u043b\u0435\u0432\u0438\u0447\">\u0413\u0435\u043e\u0440\u0433\u0438\u044f \u0421\u0435\u0434\u043e\u0432\u0430<\/a> \u043d\u0430 \u0421\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u043f\u043e\u043b\u044e\u0441 \u0432\u044b\u0448\u043b\u0430 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D1%85%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB%D1%8C%D1%81%D0%BA\" title=\"\u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u043a\">\u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u043a\u0430<\/a> \u0432 \u043c\u043e\u0440\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1913_%D0%B3%D0%BE%D0%B4\" title=\"1913 \u0433\u043e\u0434\">1913<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D1%8D%D0%BD%D0%BE%D1%81-%D0%90%D0%B9%D1%80%D0%B5%D1%81\" title=\"\u0411\u0443\u044d\u043d\u043e\u0441-\u0410\u0439\u0440\u0435\u0441\">\u0411\u0443\u044d\u043d\u043e\u0441-\u0410\u0439\u0440\u0435\u0441\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B6%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9,_%D0%92%D0%B0%D1%86%D0%BB%D0%B0%D0%B2_%D0%A4%D0%BE%D0%BC%D0%B8%D1%87\" title=\"\u041d\u0438\u0436\u0438\u043d\u0441\u043a\u0438\u0439, \u0412\u0430\u0446\u043b\u0430\u0432 \u0424\u043e\u043c\u0438\u0447\">\u0412\u0430\u0446\u043b\u0430\u0432 \u041d\u0438\u0436\u0438\u043d\u0441\u043a\u0438\u0439<\/a> \u0436\u0435\u043d\u0438\u043b\u0441\u044f \u043d\u0430 \u0420\u043e\u043c\u043e\u043b\u0435 \u0434\u0435 \u041f\u0443\u043b\u044c\u0441\u043a\u0438. \u0415\u0433\u043e \u0436\u0435\u043d\u0430 \u0431\u044b\u043b\u0430 \u0434\u043e\u0447\u0435\u0440\u044c\u044e \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0439 \u0432\u0435\u043d\u0433\u0435\u0440\u0441\u043a\u043e\u0439 \u0430\u043a\u0442\u0440\u0438\u0441\u044b \u0438 \u0432\u0440\u043e\u0434\u0435 \u0431\u044b \u0433\u0440\u0430\u0444\u0438\u043d\u0435\u0439. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%8F%D0%B3%D0%B8%D0%BB%D0%B5%D0%B2,_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B9_%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0414\u044f\u0433\u0438\u043b\u0435\u0432, \u0421\u0435\u0440\u0433\u0435\u0439 \u041f\u0430\u0432\u043b\u043e\u0432\u0438\u0447\">\u0414\u044f\u0433\u0438\u043b\u0435\u0432<\/a>, \u0443\u0437\u043d\u0430\u0432 \u043e \u0441\u0432\u0430\u0434\u044c\u0431\u0435, \u0438\u0441\u043a\u043b\u044e\u0447\u0438\u043b \u041d\u0438\u0436\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0438\u0437 \u0441\u0432\u043e\u0435\u0439 \u0442\u0440\u0443\u043f\u043f\u044b. \u041d\u0438\u0436\u0438\u043d\u0441\u043a\u0438\u0439 \u0442\u0440\u043e\u0433\u0430\u0442\u0435\u043b\u044c\u043d\u043e \u043b\u044e\u0431\u0438\u043b \u0441\u0432\u043e\u044e \u0436\u0435\u043d\u0443, \u0443 \u043d\u0438\u0445 \u0431\u044b\u043b\u043e \u0434\u0432\u0435 \u0434\u043e\u0447\u0435\u0440\u0438. \u041d\u043e \u043e\u043a\u0430\u0437\u0430\u043b\u043e\u0441\u044c, \u0447\u0442\u043e \u043e\u043d \u043d\u0435 \u043c\u043e\u0436\u0435\u0442 \u0436\u0438\u0442\u044c \u0431\u0435\u0437 \u0442\u0430\u043d\u0446\u0430, \u0438 \u0442\u043e\u0433\u0434\u0430 \u043d\u0435\u0437\u0430\u043c\u0435\u0442\u043d\u043e \u043f\u043e\u0434\u043a\u0440\u0430\u043b\u043e\u0441\u044c \u0431\u0435\u0437\u0443\u043c\u0438\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a><ul><li>\u0416\u0443\u0440\u043d\u0430\u043b\u0438\u0441\u0442 \u0438 \u0438\u0441\u0442\u043e\u0440\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A7._%D0%A0%D0%B5%D0%BF%D0%B8%D0%BD%D0%B3%D1%82%D0%BE%D0%BD&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0427. \u0420\u0435\u043f\u0438\u043d\u0433\u0442\u043e\u043d (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0427. \u0420\u0435\u043f\u0438\u043d\u0433\u0442\u043e\u043d<\/a>  \u043f\u0435\u0440\u0432\u044b\u043c \u043d\u0430\u0437\u0432\u0430\u043b \u0442\u0435\u043a\u0443\u0449\u0443\u044e \u0432\u043e\u0439\u043d\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041f\u0435\u0440\u0432\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439<\/a>.<\/li><li>\u0412\u043e\u0439\u0441\u043a\u0430 5-\u0439 \u0430\u0440\u043c\u0438\u0438, \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BB%D0%B0%D0%B2%D0%B5%D0%BD,_%D0%9F%D1%91%D1%82%D1%80_%D0%90%D0%BD%D1%82%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0421\u043b\u0430\u0432\u0435\u043d, \u041f\u0451\u0442\u0440 \u0410\u043d\u0442\u043e\u043d\u043e\u0432\u0438\u0447\">\u041f.&#160;\u0410.&#160;\u0421\u043b\u0430\u0432\u0435\u043d<\/a>, \u043e\u0441\u0432\u043e\u0431\u043e\u0434\u0438\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B7%D0%B0%D0%BD%D1%8C\" title=\"\u041a\u0430\u0437\u0430\u043d\u044c\">\u041a\u0430\u0437\u0430\u043d\u044c<\/a>. \u042d\u0442\u043e \u0431\u044b\u043b\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u043f\u043e\u0431\u0435\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%B0%D1%8F_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u041a\u0440\u0430\u0441\u043d\u0430\u044f \u0430\u0440\u043c\u0438\u044f\">\u041a\u0440\u0430\u0441\u043d\u043e\u0439 \u0410\u0440\u043c\u0438\u0438<\/a> \u043d\u0430 \u0412\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u043c \u0444\u0440\u043e\u043d\u0442\u0435.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1925_%D0%B3%D0%BE%D0%B4\" title=\"1925 \u0433\u043e\u0434\">1925<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%8B%D0%B7%D1%8B%D0%BB%D0%BE%D1%80%D0%B4%D0%B0\" title=\"\u041a\u044b\u0437\u044b\u043b\u043e\u0440\u0434\u0430\">\u041a\u044b\u0437\u044b\u043b\u043e\u0440\u0434\u0435<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u043a\u0430\u0437\u0430\u0445\u0441\u043a\u0438\u0439 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0442\u0435\u0430\u0442\u0440.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D1%81%D1%8C-%D0%A5%D1%80%D1%83%D1%81%D1%82%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9\" title=\"\u0413\u0443\u0441\u044c-\u0425\u0440\u0443\u0441\u0442\u0430\u043b\u044c\u043d\u044b\u0439\">\u0413\u0443\u0441\u044c-\u0425\u0440\u0443\u0441\u0442\u0430\u043b\u044c\u043d\u043e\u043c<\/a> \u043f\u0443\u0449\u0435\u043d \u043c\u0435\u0445\u0430\u043d\u0438\u0437\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0439 \u0441\u0442\u0435\u043a\u043e\u043b\u044c\u043d\u044b\u0439 \u0437\u0430\u0432\u043e\u0434, \u043d\u044b\u043d\u0435 \u0413\u0443\u0441\u0435\u0432\u0441\u043a\u0438\u0439 \u0441\u0442\u0435\u043a\u043e\u043b\u044c\u043d\u044b\u0439 \u0437\u0430\u0432\u043e\u0434.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d