2 \u0421\u0421\u0421\u0420 \u0443\u0441\u043f\u0435\u0448\u043d\u044b\u0439 \u043f\u0440\u0438\u0446\u0435\u043b\u044c\u043d\u044b\u0439 \u043f\u0443\u0441\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B5_%D1%80%D0%B0%D0%BA%D0%B5%D1%82%D1%8B_%D0%BF%D0%BE%D0%B4%D0%B2%D0%BE%D0%B4%D0%BD%D1%8B%D1%85_%D0%BB%D0%BE%D0%B4%D0%BE%D0%BA\" title=\"\u0411\u0430\u043b\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0440\u0430\u043a\u0435\u0442\u044b \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u044b\u0445 \u043b\u043e\u0434\u043e\u043a\">\u0431\u0430\u043b\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0440\u0430\u043a\u0435\u0442\u044b \u0420-21<\/a> \u0438\u0437-\u043f\u043e\u0434 \u0432\u043e\u0434\u044b.<\/li><li>\u041d\u0430 XVII \u043b\u0435\u0442\u043d\u0438\u0445 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0445 \u0438\u0433\u0440\u0430\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC\" title=\"\u0420\u0438\u043c\">\u0420\u0438\u043c\u0435<\/a> \u0441\u0435\u043d\u0441\u0430\u0446\u0438\u043e\u043d\u043d\u0443\u044e \u043f\u043e\u0431\u0435\u0434\u0443 \u0432 \u043c\u0430\u0440\u0430\u0444\u043e\u043d\u0441\u043a\u043e\u043c \u0431\u0435\u0433\u0435 \u043e\u0434\u0435\u0440\u0436\u0430\u043b \u043d\u0438\u043a\u043e\u043c\u0443 \u043d\u0435 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u044b\u0439 \u044d\u0444\u0438\u043e\u043f\u0441\u043a\u0438\u0439 \u0431\u0435\u0433\u0443\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D0%BA%D0%B8%D0%BB%D0%B0,_%D0%90%D0%B1%D0%B5%D0%B1%D0%B5\" class=\"mw-redirect\" title=\"\u0411\u0438\u043a\u0438\u043b\u0430, \u0410\u0431\u0435\u0431\u0435\">\u0410\u0431\u0435\u0431\u0435 \u0411\u0438\u043a\u0438\u043b\u0430<\/a>, \u0431\u0435\u0436\u0430\u0432\u0448\u0438\u0439 \u0431\u043e\u0441\u0438\u043a\u043e\u043c.<\/li><li>\u041d\u0430 \u043a\u043e\u043d\u0444\u0435