\/wiki\/%D0%92%D0%BE%D0%BB%D0%B6%D1%81%D0%BA%D0%B0%D1%8F_%D0%93%D0%AD%D0%A1\" title=\"\u0412\u043e\u043b\u0436\u0441\u043a\u0430\u044f \u0413\u042d\u0421\">\u0412\u043e\u043b\u0436\u0441\u043a\u043e\u0439 \u0413\u042d\u0421 \u0438\u043c\u0435\u043d\u0438 XXII \u0441\u044a\u0435\u0437\u0434\u0430 \u041a\u041f\u0421\u0421<\/a>. \u0421\u0442\u0440\u043e\u0438\u043b\u0430\u0441\u044c \u0413\u042d\u0421 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1951_%D0%B3%D0%BE%D0%B4\" title=\"1951 \u0433\u043e\u0434\">1951<\/a> \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1962_%D0%B3%D0%BE%D0%B4\" title=\"1962 \u0433\u043e\u0434\">1962<\/a> \u0433\u0433. \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BB%D0%B3%D0%B0\" title=\"\u0412\u043e\u043b\u0433\u0430\">\u0412\u043e\u043b\u0433\u0435<\/a> \u0432\u044b\u0448\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BB%D0%B3%D0%BE%D0%B3%D1%80%D0%B0%D0%B4\" title=\"\u0412\u043e\u043b\u0433\u043e\u0433\u0440\u0430\u0434\">\u0412\u043e\u043b\u0433\u043e\u0433\u0440\u0430\u0434\u0430<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1964_%D0%B3%D0%BE%D0%B4\" title=\"1964 \u0433\u043e\u0434\">1964<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D1%8E%D0%B0%D1%80%D1%82,_%D0%A0%D0%BE%D0%B4\" title=\"\u0421\u0442\u044e\u0430\u0440\u0442, \u0420\u043e\u0434\">\u0420\u043e\u0434 \u0421\u0442\u044e\u0430\u0440\u0442<\/a> \u0437\u0430\u043f\u0438\u0441\u0430\u043b \u0441\u0432\u043e\u0439 \u043f\u0435\u0440\u0432\u044b\u0439 \u0441\u0438\u043d\u0433\u043b \u00abGood Morning, Little Schoolgirl\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1976_%D0%B3%D0%BE%D0%B4\" title=\"1976 \u0433\u043e\u0434\">1976<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BB%D0%BA%D0%BD%D0%BE%D0%B2%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BD%D0%B0%D0%B4_%D0%97%D0%B0%D0%B3%D1%80%D0%B5%D0%B1%D0%BE%D0%BC\" title=\"\u0421\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u0435 \u043d\u0430\u0434 \u0417\u0430\u0433\u0440\u0435\u0431\u043e\u043c\">\u0441\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u0435 Trident 3B \u0438 DC-9 \u043d\u0430\u0434 \u0417\u0430\u0433\u0440\u0435\u0431\u043e\u043c<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B3%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%B8%D1%8F\" title=\"\u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u044f\">\u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u044f<\/a>). 177 \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1977_%D0%B3%D0%BE%D0%B4\" title=\"1977 \u0433\u043e\u0434\">1977<\/a>&#160;\u2014 \u0422\u0443\u043d\u0438\u0441\u0441\u043a\u0438\u0439 \u0438\u043c\u043c\u0438\u0433\u0440\u0430\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D0%BC%D0%B8%D0%B4%D0%B0_%D0%94%D0%B6%D0%B0%D0%BD%D0%B4%D1%83%D0%B1%D0%B8\" class=\"mw-redirect\" title=\"\u0425\u0430\u043c\u0438\u0434\u0430 \u0414\u0436\u0430\u043d\u0434\u0443\u0431\u0438\">\u0425\u0430\u043c\u0438\u0434\u0430 \u0414\u0436\u0430\u043d\u0434\u0443\u0431\u0438<\/a>, \u043e\u0441\u0443\u0436\u0434\u0451\u043d\u043d\u044b\u0439 \u043a\u0430\u043a \u0443\u0431\u0438\u0439\u0446\u0430, \u0441\u0442\u0430\u043b \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u043c \u043a\u0430\u0437\u043d\u0451\u043d\u043d\u044b\u043c \u043d\u0430 \u0433\u0438\u043b\u044c\u043e\u0442\u0438\u043d\u0435 \u043f\u0440\u0435\u0441\u0442\u0443\u043f\u043d\u0438\u043a\u043e\u043c \u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>. \u0427\u0435\u0440\u0435\u0437 \u0447\u0435\u0442\u044b\u0440\u0435 \u0433\u043e\u0434\u0430 \u0433\u0438\u043b\u044c\u043e\u0442\u0438\u043d\u0430, \u043a\u0430\u043a \u043e\u0440\u0443\u0434\u0438\u0435 \u0441\u043c\u0435\u0440\u0442\u043d\u043e\u0439 \u043a\u0430\u0437\u043d\u0438, \u0431\u0443\u0434\u0435\u0442 \u0437\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1981_%D0%B3%D0%BE%D0%B4\" title=\"1981 \u0433\u043e\u0434\">1981<\/a>&#160;\u2014 \u0417\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u0430\u044f \u043a\u0430\u0440\u0442\u0438\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BD%D0%B8%D0%BA%D0%B0_(%D0%BA%D0%B0%D1%80%D1%82%D0%B8%D0%BD%D0%B0)\" title=\"\u0413\u0435\u0440\u043d\u0438\u043a\u0430 (\u043a\u0430\u0440\u0442\u0438\u043d\u0430)\">\u00ab\u0413\u0435\u0440\u043d\u0438\u043a\u0430\u00bb<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%B1%D0%BB%D0%BE_%D0%9F%D0%B8%D0%BA%D0%B0%D1%81%D1%81%D0%BE\" class=\"mw-redirect\" title=\"\u041f\u0430\u0431\u043b\u043e \u041f\u0438\u043a\u0430\u0441\u0441\u043e\">\u041f\u0430\u0431\u043b\u043e \u041f\u0438\u043a\u0430\u0441\u0441\u043e<\/a> \u0432\u0435\u0440\u043d\u0443\u043b\u0430\u0441\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u044e<\/a> \u0438 \u043f\u043e\u043c\u0435\u0449\u0435\u043d\u0430 \u0432 \u043c\u0430\u0434\u0440\u0438\u0434\u0441\u043a\u043e\u043c \u043c\u0443\u0437\u0435\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%9F%D1%80%D0%B0%D0%B4%D0%BE\" class=\"mw-redirect\" title=\"\u041c\u0443\u0437\u0435\u0439 \u041f\u0440\u0430\u0434\u043e\">\u041f\u0440\u0430\u0434\u043e<\/a>. \u0412 \u0437\u0430\u0432\u0435\u0449\u0430\u043d\u0438\u0438 \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u0445\u0443\u0434\u043e\u0436\u043d\u0438\u043a\u0430, \u0441\u043a\u043e\u043d\u0447\u0430\u0432\u0448\u0435\u0433\u043e\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1973_%D0%B3%D0%BE%D0%B4\" title=\"1973 \u0433\u043e\u0434\">1973 \u0433\u043e\u0434\u0443<\/a>, \u0431\u044b\u043b\u043e \u0443\u043a\u0430\u0437\u0430\u043d\u043e, \u0447\u0442\u043e \u0432\u043e\u0437\u0432\u0440\u0430\u0449\u0435\u043d\u0438\u0435 \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e \u043b\u0438\u0448\u044c \u043f\u0440\u0438 \u0443\u0441\u043b\u043e\u0432\u0438\u0438 \u043f\u0430\u0434\u0435\u043d\u0438\u044f \u0444\u0430\u0448\u0438\u0437\u043c\u0430 \u0438 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u044f \u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0438 \u0432 \u0441\u0442\u0440\u0430\u043d\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1984_%D0%B3%D0%BE%D0%B4\" title=\"1984 \u0433\u043e\u0434\">1984<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u043e \u043c\u0430\u0442\u0447\u0430 \u0437\u0430 \u0437\u0432\u0430\u043d\u0438\u0435 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430 \u043c\u0438\u0440\u0430 \u043f\u043e \u0448\u0430\u0445\u043c\u0430\u0442\u0430\u043c \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BF%D0%BE%D0%B2,_%D0%90%D0%BD%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D0%B9_%D0%95%D0%B2%D0%B3%D0%B5%D0%BD%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0430\u0440\u043f\u043e\u0432, \u0410\u043d\u0430\u0442\u043e\u043b\u0438\u0439 \u0415\u0432\u0433\u0435\u043d\u044c\u0435\u0432\u0438\u0447\">\u0410\u043d\u0430\u0442\u043e\u043b\u0438\u0435\u043c \u041a\u0430\u0440\u043f\u043e\u0432\u044b\u043c<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%81%D0%BF%D0%B0%D1%80%D0%BE%D0%B2,_%D0%93%D0%B0%D1%80%D1%80%D0%B8_%D0%9A%D0%B8%D0%BC%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0430\u0441\u043f\u0430\u0440\u043e\u0432, \u0413\u0430\u0440\u0440\u0438 \u041a\u0438\u043c\u043e\u0432\u0438\u0447\">\u0413\u0430\u0440\u0440\u0438 \u041a\u0430\u0441\u043f\u0430\u0440\u043e\u0432\u044b\u043c<\/a>. \u041c\u0430\u0442\u0447 \u0438\u043c\u0435\u043b \u0440\u0435\u043a\u043e\u0440\u0434\u043d\u0443\u044e \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c&#160;\u2014 \u0431\u043e\u043b\u0435\u0435 5 \u043c\u0435\u0441\u044f\u0446\u0435\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1988_%D0%B3%D0%BE%D0%B4\" title=\"1988 \u0433\u043e\u0434\">1988<\/a><ul><li>\u0411\u043e\u043b\u0435\u0435 \u043f\u044f\u0442\u0438 \u0441 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u043e\u0439 \u043b\u0435\u0442 \u043f\u0440\u0438\u0448\u043b\u043e\u0441\u044c \u0436\u0434\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D0%BB%D0%B8%D0%BD%D0%B7,_%D0%A4%D0%B8%D0%BB\" title=\"\u041a\u043e\u043b\u043b\u0438\u043d\u0437, \u0424\u0438\u043b\">\u0424\u0438\u043b\u0443 \u041a\u043e\u043b\u043b\u0438\u043d\u0437\u0443<\/a>, \u0447\u0442\u043e\u0431\u044b \u043f\u043e\u0432\u0442\u043e\u0440\u0438\u0442\u044c \u0441\u0432\u043e\u0439 \u0443\u0441\u043f\u0435\u0445, \u0441\u043d\u043e\u0432\u0430 \u0437\u0430\u043d\u044f\u0432 \u043f\u0435\u0440\u0432\u043e\u0435 \u043c\u0435\u0441\u0442\u043e \u0432 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u043c \u0445\u0438\u0442-\u043f\u0430\u0440\u0430\u0434\u0435 \u0441 \u043f\u0435\u0441\u043d\u0435\u0439 \u00abA Groove Kind of Love\u00bb. \u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0436\u0435 \u0445\u0438\u0442-\u043f\u0430\u0440\u0430\u0434 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0443\u0434\u0430\u043b\u043e\u0441\u044c \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u0438\u0442\u044c \u0433\u0440\u0443\u043f\u043f\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Guns_N%27_Roses\" class=\"mw-redirect\" title=\"Guns N' Roses\">Guns N' Roses<\/a>\u00bb \u0441 \u043f\u0435\u0441\u043d\u0435\u0439 \u00abSweet Child o\u2019Mine\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D1%84,_%D0%A8%D1%82%D0%B5%D1%84%D1%84%D0%B8\" title=\"\u0413\u0440\u0430\u0444, \u0428\u0442\u0435\u0444\u0444\u0438\">\u0428\u0442\u0435\u0444\u0444\u0438 \u0413\u0440\u0430\u0444<\/a>, \u043f\u043e\u0431\u0435\u0434\u0438\u0432 \u043d\u0430 \u041e\u0442\u043a\u0440\u044b\u0442\u043e\u043c \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442\u0435 \u0421\u0428\u0410, \u0441\u0442\u0430\u043b\u0430 \u043f\u0435\u0440\u0432\u043e\u0439 \u0442\u0435\u043d\u043d\u0438\u0441\u0438\u0441\u0442\u043a\u043e\u0439, \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0443\u0434\u0430\u043b\u043e\u0441\u044c \u0437\u0430\u0432\u043e\u0435\u0432\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D0%BD%D0%B8%D1%80%D1%8B_%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B3%D0%BE_%D1%88%D0%BB%D0%B5%D0%BC%D0%B0_(%D1%82%D0%B5%D0%BD%D0%BD%D0%B8%D1%81)\" title=\"\u0422\u0443\u0440\u043d\u0438\u0440\u044b \u0411\u043e\u043b\u044c\u0448\u043e\u0433\u043e \u0448\u043b\u0435\u043c\u0430 (\u0442\u0435\u043d\u043d\u0438\u0441)\">\u0411\u043e\u043b\u044c\u0448\u043e\u0439 \u0448\u043b\u0435\u043c<\/a> \u043f\u043e\u0441\u043b\u0435 \u0430\u043d\u0430\u043b\u043e\u0433\u0438\u0447\u043d\u043e\u0433\u043e \u0434\u043e\u0441\u0442\u0438\u0436\u0435\u043d\u0438\u044f \u0430\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u0439\u0441\u043a\u043e\u0439 \u0441\u043f\u043e\u0440\u0442\u0441\u043c\u0435\u043d\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D1%82,_%D0%9C%D0%B0%D1%80%D0%B3%D0%B0%D1%80%D0%B5%D1%82\" title=\"\u041a\u043e\u0440\u0442, \u041c\u0430\u0440\u0433\u0430\u0440\u0435\u0442\">\u041c\u0430\u0440\u0433\u0430\u0440\u0435\u0442 \u041a\u043e\u0440\u0442<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1970_%D0%B3%D0%BE%D0%B4\" title=\"1970 \u0433\u043e\u0434\">1970 \u0433\u043e\u0434\u0443<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B4%D0%B5%D1%81%D1%81%D0%B0\" title=\"\u041e\u0434\u0435\u0441\u0441\u0430\">\u041e\u0434\u0435\u0441\u0441\u0435<\/a> \u043d\u0430\u0447\u0430\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u043a\u043e\u0